import { Link } from "react-router-dom";
import React, { Component, useState } from "react";
import LoginTitle from "./logintitle";
import axios from "../../utils/request";

const logoStyle = {
    position: 'absolute',
    width: '397px',
    height: '131px',
    left: '122px',
    top: '83px'
}

const textsStyle = {
    position: 'absolute',
    left: '8.47%',
    right: '57.78%',
    top: '26.59%',
    bottom: '26.23%',
    fontFamily: "'DM Sans', sans-serif",
    color: '#113f67'
}

const titleStyle = {
    fontFamily: 'DM Sans',
    fontSize: '40px',
    fontWeight: 'Bold',
    lineHeight: '150%'
}

const contentStyle = {
    fontStyle: 'normal',
    fontSize: '30px',
    fontWeight: '500'
}

class SignInForm extends Component {
    handleSubmit = async e => {
        e.preventDefalut();
        const {data} = await axios.post('api/login');
        console.log(data);
    };

    render() {
        return (
            <div id="signin-page">
                <Link to="/"><img src="./LOGO-H 1.png" style={logoStyle} alt="logo"></img></Link>
                <div style={textsStyle}>
                    <h1 style={titleStyle}>Welcome to Misinformation Detective. We identify the misinformation in the best way for you.</h1>
                    <h3 style={contentStyle}>We've done it carefully and simply. Combined with the ingredients makes for beautiful landings.
                        It is definitely the tool you need to speed up your design process.</h3>
                </div>
                <div>
                    <form id="sign-form" onSubmit={this.handleSubmit}>
                        <LoginTitle />
                        <div>
                            <label className="user-info">
                                <input type="text" name="username" placeholder="Your username..." className="username" />
                            </label>
                        </div>
                        <div>
                            <label className="user-info">
                                <input type="password" name="password" placeholder="Your password..." className="password" />
                            </label>
                        </div>
                        <div id="sign-radio">
                            <label>
                                <input type="radio" value="Normal" name="identity" className="identity" />Normal
                            </label>
                            <label>
                                <input type="radio" value="Professional" name="identity" className="identity" />Professional
                            </label>

                        </div>
                        <div>
                            <label id="sign-condition">
                                <input type="checkbox" name="condition" />I agree to the terms of service
                            </label>
                        </div>
                        <div id="sign-btn">
                            <input type="submit" value="Sign In" />
                        </div>


                    </form>
                </div>

            </div>
        )
    }
};



export default SignInForm;
